import React from 'react';
import AllGames from '../components/AllGames/allGames';


const Products = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'left',
		alignItems: 'start',
		height: '100vh',
		fontStyle :'italic',
		fontFamily : 'dancing-script'
	}}
	>
	<h1>All games</h1>
	<AllGames/>

	</div>
)
};

export default Products;
